$.validator.addMethod("personnummer",function(f){if(f.length==0){return true}f=f.replace("-","");if(f.length==12){f=f.substr(2,10)}else{if(f.length==10){f=f.substr(0,10)}else{return false}}var c=parseInt(f.substr(9,1),10);f=f.substr(0,9);var b=0;for(var e=0,a=f.length;e<a;e++){var d=parseInt(f.substr(e,1),10);if((e%2)==0){d=(d*2)}if(d>9){b+=(1+(d%10))}else{b+=d}}return(((c+b)%10)==0)});